import '../styles'

function MyApp({ Component, pageProps }) {
  let localStorage
  if (typeof window !== "undefined") {
    console.log(window)
    localStorage = window.localStorage
  }

  return <Component {...pageProps} localStorage={localStorage} />
}

export default MyApp
